import React from 'react';

const AboutMe = () => {
	return(
		<div className='about_me'>
			<div className='about_me-header'>
				<p className='f4 tc '>Hi! <br/>My name is Anirudh. <br/>
				<br/>
				I’m a software engineer who's always looking for challenging opportunities. As technology continues to evolve it creates new roadblocks and problems to solve. There’s always more to learn, more to experience, and even more to create. My passion stems from this opportunity to challenge myself - learning as much as possible in new, unexplored areas, and solving complex problems.

				<br/>After graduating in June 2018, I joined Workday's engineering team under Financials to build varied, meaningful, and interesting applications on a daily basis. As of today I have ~2 years of experience building complex, scalable applications on the cloud. I’ve had the wonderful opportunity to explore building both customer facing frontend and internal backend tooling products which has granted me a diverse skillset of programming languages and technologies. In addition, I specialized in machine learning for my Masters Dissertation with a heavy focus on research, design, and implementation of modern day computer vision neural network models with an application to object classification and detection in games. Through these diverse experiences, I’ve learned that I enjoy tackling challenges head on and look forward to finding my next big one! 

				<br/>My overall goal is to progress as a machine learning engineer alongside the evolving technology and find a way to make software more accessible to everyone.



				</p>
			</div>

		</div>

	);
}

export default AboutMe;
